window.addEventListener('load', function () {
    var analyseur = new DOMParser();
    conjugaison = analyseur.parseFromString(conjugaison, 'text/xml').documentElement;
    verbes = analyseur.parseFromString(verbes, 'text/xml').documentElement;
    document.getElementById('corriger').addEventListener('click', corriger);
    preparer();
});

var modes_temps = [
        ['indic', 'pr'],
        ['indic', 'fs'],
        ['indic', 'impf'],
        ['indic', 'ps'],
        ['imper', 'pr'],
        ['subj', 'pr'],
        ['cnd', 'pr']
        ],
    personnes = ['je', 'tu', 'il/elle', 'nous', 'vous', 'ils/elles'],
    personnes_subj = ['que je', 'que tu', 'qu’il/elle', 'que nous', 'que vous', 'qu’ils/elles'],
    personnes_imper = ['(2e sg.)', '(1re pl.)', '(2e pl.)'],
    abr = {
        indic: 'indicatif',
        subj: 'subjonctif',
        imper: 'impératif',
        cnd: 'conditionnel',
        pr: 'présent',
        impf: 'imparfait',
        fs: 'futur simple',
        ps: 'passé simple'
    };

function preparer() {
    var fragment = document.createDocumentFragment(),
        p,
        label,
        label_pers,
        input,
        verbe,
        mode_temps,
        personne,
        nombre = 10,
        solution,
        p_sol,
        i;
    
    for (i = 0; i < nombre; i++) {
        verbe = selection[Math.floor(Math.random() * selection.length)];
        mode_temps = modes_temps[Math.floor(Math.random() * modes_temps.length)];
        if (mode_temps[0] === 'imper') {
            personne = Math.floor(Math.random() * 3);
        } else {
            personne = Math.floor(Math.random() * 6);
        }
        
        solution = conjuguer(verbe, mode_temps[0], mode_temps[1], personne);
        
        p = document.createElement('p');
        input = document.createElement('input');
        input.type = 'text';
        input.dataset.solution = solution;
        input.className = 'reponse';
        label = document.createElement('label');
        label.innerHTML = '<em>' + verbe + '</em>, ' +
            abr[mode_temps[0]] + ' ' + abr[mode_temps[1]];
        label.style.display = 'inline-block';
        label.style.width = '13em';
        label_pers = document.createElement('label');
        switch (mode_temps[0]) {
            case 'imper':
                label_pers.textContent = personnes_imper[personne];
                break;
            case 'subj':
                if (personne == 0 && ('aàâeëéêiîoôöûùüu'.indexOf(solution.substr(0, 1)) > -1)) {
                    label_pers.textContent = 'que j’';
                } else {
                    label_pers.textContent = personnes_subj[personne];
                }
                break;
            default:
                console.log('aàâeëéêiîoôöûùüu'.indexOf(solution.substr(0, 1)));
                if (personne == 0 && ('aàâeëéêiîoôöûùüu'.indexOf(solution.substr(0, 1)) > -1)) {
                    label_pers.textContent = 'j’';
                } else {
                    label_pers.textContent = personnes[personne];
                }
                break;
        }
        
        label_pers.style.display = 'inline-block';
        label_pers.style.width = '4.5em';
        label_pers.style.marginRight = '0.5em';
        label_pers.style.textAlign = 'right';
        p.appendChild(label);
        p.appendChild(label_pers);
        p.appendChild(input);
        p_sol = document.createElement('span');
        p_sol.className = 'commentaire';
        p_sol.style.margin = '0 1em';
        p_sol.style.padding = '0';
        p_sol.textContent = solution;
        p.appendChild(p_sol);
        fragment.appendChild(p);
    }
    
    document.getElementById('verbes').appendChild(fragment);
    
}

function corriger() {
    var reponses = document.getElementsByClassName('reponse'),
        i;
    
    for (i = 0; i < reponses.length; i++) {
        if (reponses[i].dataset.solution.split('|').indexOf(reponses[i].value) > -1) {
            reponses[i].className = 'reponse correcte';
            reponses[i].nextElementSibling.style.display = 'none';
        } else {
            reponses[i].className = 'reponse incorrecte';
            reponses[i].nextElementSibling.style.display = 'inline';
        }
        reponses[i].setAttribute('disabled', 'disabled');
    }
    
    document.getElementById('corriger').setAttribute('disabled', 'disabled');
}

function conjuguer(verbe, mode, temps, personne) {
    console.log(verbe, mode, temps, personne);
    var m = verbes.querySelector('v[i="' + verbe + '"]').textContent,
        radical = verbe.substr(0, verbe.length - m.replace(/^[^:]*:/,'').length),
        terminaisons = conjugaison.querySelector(`m[nom="${m}"] ${mode} ${temps}`).children[personne],
        solutions = [];
    
    for (let i = 0; i < terminaisons.childElementCount; i++) {
        solutions.push(radical + terminaisons.children[i].textContent);
    }
    return solutions.join('|');
}

